import React, { Component } from "react";
import NavBar from "./components/navbar";
import "./App.css";

import Counters from "./components/counters";

class App extends Component {
  render() {
    return (
      <div>
        <NavBar />
        <main className="container">
          <Counters />
        </main>
      </div>
    );
  }
}

export default App;
